import "./online.css"

export default function Online({user}) {
    if (!user)
        return null;
    return (
        <li className="sidebarFriend">
            <img className="sidebarFriendImg" src={user.profilePicture}/>
            <span className="sidebarFriendName"> {user.username}  </span>
        </li>
    )
}
